import React from 'react';

const StarWarsIcon = () => {
  return (
    <svg width="50" height="50" viewBox="0 0 50 50" fill="none" xmlns="http://www.w3.org/2000/svg" xmlnsXlink="http://www.w3.org/1999/xlink">
      <rect y="2" width="50" height="46.0486" fill="url(#pattern3)"/>
      <defs>
        <pattern id="pattern3" patternContentUnits="objectBoundingBox" width="1" height="1">
          <use xlinkHref="#image3" transform="scale(0.00303951 0.00330033)"/>
        </pattern>
        <image id="image3" width="329" height="303" xlinkHref="data:image/png;base64,"/>
      </defs>
    </svg>
  );
};

export default StarWarsIcon;
